zui.directive("pickerdate",function(){

	var type = {
		"month":{"startView":'year',"minView":'year',"format":'yyyy-mm',"autoclose":true},
		"day":{"format":'yyyy-mm-dd',"autoclose":true,"minView":"month"},
		"quarter":{"format":'yyyy-mm',"autoclose":true,"minView":"year","startView":"year","isQuarter":true},
		"year":{"format":"yyyy","autoclose":true,"startView":"decade","minView":"decade"}
	};

	function link(scope, element, attrs){
		var cate = attrs['cate'] || "day";
		$(element).datetimepicker( type[cate] );
	}

	 return {
      link:link
    };
});

// 比率
zui.filter('rate', function() {
  return function(input) {
    return (typeof input === 'string' || typeof input === "number") ? (input*100).toFixed(2) + "%" : "";
  };
});

// 数组和
zui.filter('total',function(){
	var sum = function( arr, key ){
		var total = 0;
		for(var i = 0,l=arr.length;i<=l-1;i++){
			total += !!key ? arr[i][key] : arr[i];
		}
		return total;
	};
	return function(input,key){
		return input.length ? sum(input,key) : input;
	};
});

// 首字母大写
zui.filter('capitalize', function() {
    return function(input) {
        return input.substring(0,1).toUpperCase()+input.substring(1);
    };
});
zui.controller('headerController',function($scope,$cookies,$http,$location) {
	$scope.userName = $cookies.userName;
    function DelCookie(name)
    {
    var exp = new Date();
    exp.setTime (exp.getTime() - 1);
    var cval = GetCookie (name);
    document.cookie = name + "=" + cval + "; domain=.qunar.com;expires="+ exp.toGMTString();
    }
    
    $("header .logout").click(function(){
        $http.jsonp("https://qsso.corp.qunar.com/api/logout.php?callback=JSON_CALLBACK").success(function(res){
            if( !!res.ret ){
                window.location.href="/";
            }
        });
        // document.cookie = "userName=;domain=.qunar.com;path=/;expires=Thu, 01 Jan 1970 00:00:00 GMT";
        return false;
    });
});
zui.directive("ngMenu",function($http,$location){

  var host = $location.host(),
      url = $location.absUrl(),
      rUrl = new RegExp(".*"+host);
      currentUrl = url.replace(rUrl,"");

  function link(scope, element, attrs){
    var url = attrs['url'];

    $http.get(url+"?t="+( +new Date() ) ).success(function(res) {
      var menus = res.data.menus,
          current;
      angular.forEach(menus, function(value, key){
        value.isShow = false;
        angular.forEach(value.data,function(v,k){
          if( v.url === currentUrl ){
            value.isShow =true;
          }
        });
      });
      scope.menus = menus;
    });

    // 当前class
    scope.getClass = function(one){
      if( one.url === currentUrl ){
        return "menu-active";
      }
    }

    $(element)
      .on("click",".menu-t",function(){
        $(this).find(".glyphicon ").toggleClass("glyphicon-plus glyphicon-minus");
        $(this).siblings(".menu-c").slideToggle();
        $(this).parent().siblings().find(".menu-c:visible").slideToggle();
        $(this).parent().siblings().find(".glyphicon-minus").toggleClass("glyphicon-plus glyphicon-minus");
      })
      .on("click",".menu-c a",function(){
        currentUrl = $(this).attr("href");
        document.title = "QBOSS-"+$(this).attr("title");
      });
  }

   return {
      link:link
    };
});
